INSERT INTO `settings` VALUES (1,'home_page',_binary 'a:4:{s:4:\"logo\";a:2:{s:12:\"primary_logo\";s:74:\"public/img/upload_files/5932e858-727c-47a0-90b4-54293f8d03711611471486.png\";s:14:\"secondary_logo\";s:74:\"public/img/upload_files/e688ae77-181e-4e28-a541-1be1d66f27761611471486.png\";}s:7:\"heading\";s:11:\"Coming Soon\";s:11:\"information\";a:3:{s:12:\"address_line\";s:7:\"address\";s:12:\"phone_number\";s:9:\"123456789\";s:5:\"email\";s:24:\"info@justconvenience.com\";}s:14:\"email_template\";a:1:{s:18:\"welcome_email_text\";s:7:\"Welcome\";}}',1,'2020-07-21 10:32:52',NULL,'2021-01-24 01:59:28'),(2,'tnc',_binary 's:9999:\"<ul>\r\n	<li>\r\n	<h2><strong>Just Convenience Ltd Terms &amp; Conditions</strong></h2>\r\n	</li>\r\n</ul>\r\n\r\n<p>Please read these terms and conditions along with our privacy policy before ordering through our website or apps.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h2><strong>THE COMPANY</strong></h2>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>COMPANY DETAILS</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>Just Convenience is a company registered in England with registered company number is 12148577. Our registered office is 47 Bassett Street, Walsall, WS2 9QA. Our Trading Address is 47 Bassett Street, Walsall, WS2 9QA.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>OUR CONTACT DETAILS</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>You may contact us by telephone on 07438128915 or using our contact form https://www.justconvenience.co.uk/contact . We would request that in the first instance if you have any issues with your order/delivery, you should directly contact the store responsible for your order, the details of which will be available to you when placing your order.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h2><strong>ORDERS</strong></h2>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>YOUR ORDER</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>We at Just Convenience provide a method for you to place an order with your local convenience store. When you have placed an order, your contract is with that store for the purchase of the products and for the delivery service. For the avoidance of doubt, your contract is not with Just Convenience for the purchase of the products or for the delivery service. We, Just Convenience are therefore not liable for any damages or any losses that you may incur (not withstanding as a direct result of Just Convenience&rsquo;s own negligence), including without limitation in relation to defective goods or products, damages to your order, or late delivery of your order.</p>\r\n\r\n<p>By ordering via Just Convenience, you are indicating that you understand and agree to these terms.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>YOUR STATUS</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>By agreeing to the Terms, you represent that you are:</p>\r\n\r\n<ul>\r\n	<li>At least as old as the age specified&nbsp;<a href=\"https://support.google.com/accounts/answer/1350409\">here</a> (18); and</li>\r\n	<li>capable of entering into a legally binding agreement with the store.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>ALLERGY INFORMATION</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>In the event that you suffer from any allergies, we would ask that you agree to always check the label of products purchased for information regarding the ingredients as Just Convenience will not be held liable for any damages/injuries arising as a result of the same</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>ORDERS CONTAINING ALCOHOL, TOBACCO OR OTHER AGE RESTRICTED ITEMS</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>Age restricted products (including, without limitation, alcohol, tobacco and cigarettes) can only be sold and delivered to persons aged 18 or over. By placing an order for an age restricted product, you confirm that you are at least 18 years old. Just Convenience operates an age verification policy whereby customers ordering age restricted products will be asked by the delivery driver to provide proof that they are aged 18 or over before the delivery is completed. The delivery driver may refuse to deliver any age restricted product to any person unless they can provide valid photo ID proving that they are aged 18 or over. The selected shop and the delivery driver may refuse to deliver alcohol to any person who is or appears to be under the influence of either alcohol or drugs. If delivery of any age restricted product is refused, you will still be charged for the relevant Item and for the delivery.</p>\r\n\r\n<p><strong>DELIVERY/COLLECTION TIMES</strong></p>\r\n\r\n<p>All delivery or collection times are estimates only, we do not guarantee that that the order will be delivered or ready for collection by the quoted time.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>REJECTED/ACCEPTED ORDERS</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>You may cancel an order without charge at any time before the store has started preparing the order. If you wish to cancel an order before it is prepared, please contact the store directly via the details provided on your order form. If the store confirms the order was not a completed, we will refund your payment directly via the method utilised for payment . If you cancel any order after it has been dispatched you will also be charged for delivery. &nbsp;</p>\r\n\r\n<p>Just Convenience Ltd and/or the selected store may notify you that an order has been cancelled at any time. You will not be charged for any orders cancelled by us or the Partner, and we will reimburse you for any payment already made using the same method you used to pay for your order.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When you place an order through Just Convenience, we will send your order to the relevant store. On receipt of your order the store will either accept or reject your order. Although almost all orders will be accepted, there may be times where a store is unavailable to fulfil your order and the order will be rejected. This may be because items are out of stock or the stores unable to make a delivery at that time.</p>\r\n\r\n<p>When an order is rejected you will receive a notification by email. Any payment made will be voided. For most banks this will show on your statement within 24 hours, however some banks may take up to 10 days to refund the transaction.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>SUBSTITUTIONS/OUT OF STOCK ITEMS</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>Stores will always endeavour to provide you with the products you ordered, where a product is no longer in stock stores may choose to substitute that product with an alternative. Where an alternative is cheaper than the original product you will be refunded the difference. Where an alternative is more expensive there will be no extra cost.</p>\r\n\r\n<p>Any substitutions made will be highlighted on the receipt, please check your receipt on delivery / collection and confirm you are happy with the substituted items.</p>\r\n\r\n<p>If you are unhappy with any of the items they can be returned to the driver and you will receive a refund for those items.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>CHANGES AND CANCELLATIONS</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>After an order is placed with Snappy Shopper, stores are not obligated to accept amendments or cancel the order. However, most will be willing to do so as long as the order has not already left their premises. It is recommended you contact the store directly if you would like to request a cancellation or amendment to your order.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong>PRICE MARKED PRODUCTS/PRICING</strong></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>The price of the product you order will be on our Just Convenience site/app at the time you place your order or amend your order. If a new price or promotion is in place after you have placed your order for example, a price reduction or multipack pricing which may be advertised on the packaging of goods you have ordered, these prices and promotions will not be applied to your order.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<ol>\r\n		<li>&nbsp;</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h2><strong>SERVICE CHARGE</strong></h2>\r\n	</li>\r\n</ul>\r\n\r\n<p>As part of the transaction, you will be charged a small service charge (5%) for the use of our service. There will be no partial refunds for this service charge in the event some items are unavailable or not accepted. In the event your order is cancelled or refunded in its entirety the service charge will also be refunded.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h2><strong>LIABILITY</strong></h2>\r\n	</li>\r\n</ul>\r\n\r\n<p>We are responsible to you for any loss or damage that you suffer that is a foreseeable result of our breaking these Terms or of failing to use reasonable care and skill in relation to your use of our Service. We are not responsible for any loss or damage that is not foreseeable. Loss or damage is &ldquo;foreseeable&rdquo; if it is either obvious that it will happen, or if you told us that it might happen, for example if you tell us about particular circumstances that might increase the loss or damage arising from our breach of these Terms before you place an order.</p>\r\n\r\n<p>Our terms and conditions do not exclude or limits our liability for death or personal injury arising from our negligence, our liability for fraudulent misrepresentation, or any other liability which cannot be excluded or limited under applicable law.</p>\r\n\r\n<p>Our maximum liability is the value of your order.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Other Terms</strong></p>\r\n\r\n<p><strong>If either we or you have any right to enforce these Terms against the other, that right will not be lost even if the person who has the right delays enforcing it or waives their right to enforce it in any instance. &nbsp;If a court or other authority decides that any part of these Terms is illegal or ineffective, the rest of the terms will be unaffected and will remain in force.</strong></p>\r\n\r\n<p>We may change these Terms from time to time. If we make any changes which affect your rights in relation to our Service, we will notify you. Changes to the Terms will not affect any orders you have placed where we have sent the Confirmation Notice. These Terms are governed by English law and you can bring legal proceedings in relation to our Service in the English courts. If you live in Scotland you can bring legal proceedings in respect of the Items in either the Scottish or the English courts. If you live in Northern Ireland you can bring legal proceedings in respect of the Items in either the Northern Irish or the English courts. We are required by EU law to provide&nbsp;<a href=\"https://ec.europa.eu/consumers/odr/main/index.cfm?event=main.home2.show&amp;lng=EN\">this link</a>&nbsp;to the EU&rsquo;s online dispute resolution portal, however we do not participate in dispute resolution under this process.</p>\";',1,'2020-08-01 13:41:48',NULL,'2021-01-24 11:52:56'),(3,'image_upload',_binary '1',1,'2020-08-06 15:07:41',NULL,'2020-12-02 00:56:42');
